import React from 'react';
import Grid from '@material-ui/core/Grid';
import './SvgCard.css';



export default function SvgCard() {


  return (
    <div className="svg_card">
      <Grid container spacing={1}>
        <Grid container item xs={12} spacing={3}>
          <Grid item xs={12} md={3} className="card_main">
            <img src="images/Svg/svg1.svg" width="150px"></img>
          </Grid>
          <Grid item xs={12} sm={3}>
            <img src="images/Svg/svg2.svg" width="300px"></img>
          </Grid>
          <Grid item xs={12} sm={3}>
            <img src="images/Svg/svg3.svg" width="200px"></img>
          </Grid>
          <Grid item xs={12} sm={3}>
            <img src="images/Svg/svg4.svg" width="200px"></img>
          </Grid>
        </Grid>

      </Grid>
    </div>
  );
}
